  false,\n\t\"url\": null,\n\t\"notes\": \"Belt transects along 1 or 2 consecutively-placed,
  25m transect lines were surveyed as part of Rapid Ecological Assessments conducted
  at 14 sites at Wake Atoll in October, 2005 from the NOAA vessel Oscar Elton Sette
  (OES05-13). Raw survey data included species presence and relative abundance, colony
  counts and size classes, and determination of benthic cover using the line-intercept
  method. One meter on each side of the transect lines were included in the belt (for
  a total of 50m2 or 100m2 per site), depending on the number of transects surveyed.\",\n\t\"owner_org\":
